function Contact() {
  return (
    <div>
      <h1 style={{ textAlign: "center", fontSize: "40px", marginTop: 0 }}>Get in Touch</h1>
      <div className="text-block slide-in-up">
        <h1 style={{ textAlign: "center", fontSize: "15px", marginTop: 0 }}>Contact</h1>
        <p style={{ textAlign: "center",fontSize: "18px", margin: "10px 0" }}>+91 7757949693</p>
        <h1 style={{ textAlign: "center", fontSize: "15px", marginTop: 0 }}>Address</h1>

        <p style={{ fontSize: "18px", margin: "10px 0" }}>
          2, Sharda Heritage, Narhe, Sinhgad Road, Pune 411032 (India)
        </p>
        <h1 style={{ textAlign: "center", fontSize: "15px", marginTop: 0 }}>E-mail ID</h1>
        <p style={{ textAlign: "center",fontSize: "18px", margin: "10px 0" }}>
         <a href="https://mail.google.com/mail/?view=cm&to=tarunkadam0806@gmail.com" target="_blank">Email Us</a>


        </p>
      </div>
    </div>
  );
}

export default Contact;
